export function getAvailableSpots(board) {
  let indexFinder = 0
  let spots = []
  for (let spot of board) {
    indexFinder++
    if (spot !== 'O' && spot !== 'X') {
      spots.push(indexFinder - 1)
    }
  }
  return spots
}
